import React from "react";

const LibrarySongs = ({ songs }) => {
    return (
        <div className="library-song">
            <img src={songs.cover} />
            <div className="song-description">
                <h2>{songs.name}</h2>
                <h3>{songs.artist}</h3>
            </div>

        </div>
    )
}

export default LibrarySongs;
